// import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
// import MainPage from './MyComponents/landingPage/MainPage';
// import MyProfile from './MyComponents/profile/MyProfile';
import Details from './MyComponents/landingPage/Details';
import Home from './MyComponents/Home';
import {
  BrowserRouter as Router,
  Routes as Switch,
  Route,
} from "react-router-dom";
import axios from 'axios';
import { useState } from 'react';

function setToken (usertoken)
{
  sessionStorage.setItem('token', usertoken.data.value);
}

function getToken () {
  const tokenString = sessionStorage.getItem('token');
  return tokenString.token;
}

function App() {
  let st = {
    margin: '1%'
  };
  const token = getToken();

  if (!token)
  {
    return <Home setToken={setToken} />
  }

  return (
    <div style={st}>
    <Router>
      <Switch>
        <Route exact path="/Details" element={<Details />} />
        {/* <Route exact path="/MyProfile" element={<MyProfile />} />
        <Route exact path="/" element={<MainPage />} /> */}
      </Switch>
    </Router>
    </div>
  );
}

export default App;
